subSubSection.paragraph:
Male terminalia
. Apex of ventral median lobe emarginate and apex of dorsal lobe narrowly rounded or slightly pointed; ventral lobe longer than dorsal lobe; spined region of internal sac divided into two sections: first section longer than unspined gap between first and second sections, with fairly dense short simple spines; second section about as long as first section, with sparse short simple spines (
Fig. 83a
). Eighth sternite obliquely truncate or more or less rounded at side, clearly emarginate at apex, with sparse long setae arising terminally; ventral surface with cloud-like processes (
Fig. 83b
). Eighth tergite shallowly emarginate at apex; dorsal surface with fairly dense short simple spines and multi-branched spines in basal area (
Fig. 83c
). Paramere 1.96–1.98 × as long as wide, cylindrical in shape, apex rounded with long and short setae (
Fig. 83d
).

Ovipositor and spermatheca.
Ovipositor relatively long; styli arising terminally with short and long hairs (
Fig. 83e
). Spermatheca curved, particularly near apex; spermathecal gland short and arising at basal 1/3 (
Fig. 83f
)
